import { container, title } from "assets/jss/material-kit-react.js";

const carouselStyle = {
  section: {
    padding: "70px 0",
  },
  container,
  marginAuto: {
    marginLeft: "auto !important",
    marginRight: "auto !important",
  },
  title: {
    ...title,
    marginTop: "30px",
    minHeight: "32px",
    //textDecoration: "none",
  },
};

export default carouselStyle;
